import React, { Component } from 'react';
import styles from '../Slider/Slider.module.css';

class Slider extends Component {
  constructor(props) {
    super(props);
    this.state = {
      currentSlide: 0,
    };
  }

  render() {
    return <div></div>;
  }
}

export default Slider;
